import React, {Component} from 'react';
import AircraftServices from "../../services/AircraftServices";
import FlightServices from "../../services/FlightServices";
import LocalizationProvider from "@mui/lab/LocalizationProvider";
import AdapterDateFns from "@mui/lab/AdapterDateFns";
import Stack from "@mui/material/Stack";
import DateTimePicker from "@mui/lab/DateTimePicker";
import TextField from "@mui/material/TextField";
import Aircraft from "../reusableComponents/Aircraft";
import Flight from "../reusableComponents/Flight";

class UpdateFlightComponent extends Component {
    constructor(props) {
        super(props);
        this.state = {
            id: this.props.match.params.id
        }
    }


    render() {
        return (
            <div>
                <Flight
                    history={this.props.history}
                    id={this.state.id}
                    button='Update'
                    title='Update Flight'
                />
            </div>
        );
    }
}

export default UpdateFlightComponent;
